<textarea id=check1textarea>
model SineVoltage
    constant Real pi = Modelica.Constants.pi;
    parameter Modelica.SIunits.Voltage V(start = 1) "Amplitude of sine wave";
    parameter Modelica.SIunits.Angle phase = 0 "Phase of sine wave";
    parameter Modelica.SIunits.Frequency freqHz(start = 1) "Frequency of sine wave";
    extends Modelica.Electrical.Analog.Interfaces.OnePort;
equation
    v = V * sin(2 * pi * freqHz * time + phase);
end SineVoltage;
</textarea>  <div id=check1div> </div> <br>
<textarea id=check2textarea>
model NonLinearResistor1
  extends Modelica.Electrical.Analog.Interfaces.OnePort;
  parameter Real a = 1;
  parameter Real b = 1;
equation
  i = a * tanh(b * v);
  annotation(Icon(coordinateSystem(extent = {{-100, -100}, {100, 100}}, preserveAspectRatio = true, initialScale = 0.1, grid = {2, 2}), graphics = {Rectangle(origin = {1.53, 0.65}, fillColor = {255, 0, 0}, fillPattern = FillPattern.CrossDiag, extent = {{-74.29, 20.7}, {74.29, -20.7}})}));
end NonLinearResistor1;
</textarea>  <div id=check2div> </div> <br>
<textarea id=check3textarea>
model NonLinearResistor2
  extends Modelica.Electrical.Analog.Interfaces.OnePort;
  parameter Real a = 1;
  parameter Real b = 1;
equation
  v = 0.5 / b * Modelica.Math.log((1 + i / a) / (1 - i / a));
  annotation(Icon(coordinateSystem(extent = {{-100, -100}, {100, 100}}, preserveAspectRatio = true, initialScale = 0.1, grid = {2, 2}), graphics = {Rectangle(origin = {0.65, -0.22}, fillColor = {255, 85, 255}, fillPattern = FillPattern.CrossDiag, extent = {{-76.91, 18.08}, {76.91, -18.08}})}));
end NonLinearResistor2;
</textarea>  <div id=check3div> </div> <br>
<textarea id=check4textarea>
model TestNonLinear1
    NonLinearResistor1 R(a = 0.16666666, b = 6) annotation(Placement(transformation(extent = [0, 20; 20, 40], rotation = -90)));
    Modelica.Electrical.Analog.Basic.Inductor I(i(start = 0.15)) annotation(Placement(transformation(extent = [-30, 40; -10, 60])));
    SineVoltage S annotation(Placement(transformation(extent = [-60, 20; -40, 40], rotation = 90)));
    Modelica.Electrical.Analog.Basic.Ground G annotation(Placement(transformation(extent = [0, -12; 20, 8])));
equation
    connect(I.n, R.p) annotation(Line(points = [-10, 50; 10, 50; 10, 40], style(color = 3, rgbcolor = {0, 0, 255})));
    connect(R.n, G.p) annotation(Line(points = [10, 20; 10, 8], style(color = 3, rgbcolor = {0, 0, 255})));
    connect(S.n, I.p) annotation(Line(points = [-50, 40; -50, 50; -30, 50], style(color = 3, rgbcolor = {0, 0, 255})));
    connect(S.p, G.p) annotation(Line(points = [-50, 20; -50, 8; 10, 8], style(color = 3, rgbcolor = {0, 0, 255})));
end TestNonLinear1;
</textarea>  <div id=check4div> </div> <br>
<textarea id=check5textarea>
model TestNonLinear2

    annotation (extent=[10,30; 30,50], rotation=-90);
  Modelica.Electrical.Analog.Basic.Inductor I(i(start=0.15))
    annotation (extent=[-20,50; 0,70]);
  SineVoltage S
    annotation (extent=[-50,30; -30,50], rotation=90);
  Modelica.Electrical.Analog.Basic.Ground G annotation (extent=[10,-2; 30,18]);
equation
  connect(I.n, R.p) annotation (points=[0,60; 20,60; 20,50], style(color=3,
        rgbcolor={0,0,255}));
  connect(R.n, G.p) annotation (points=[20,30; 20,18],                  style(
        color=3, rgbcolor={0,0,255}));
  connect(S.n, I.p) annotation (points=[-40,50; -40,60; -20,60],         style(
        color=3, rgbcolor={0,0,255}));
  connect(S.p, G.p) annotation (points=[-40,30; -40,18; 20,18], style(color=3,
        rgbcolor={0,0,255}));
end TestNonLinear2;
